    (append-path path color x y)))

(defn tile-2 [x y]
  (for [[color path] ground-tile-2]
    (append-path path color x y)))

(for [y (range -400 450 39)]
  (apply tile-1 (isometric->screen 1330 (+ y 6))))

(for [x (range 475 1320 40)]
  (apply tile-2 (isometric->screen (- x 2) 458)))

(defn factory [x y]
  (for [[color path] factory-button]
    (append-path path color x y 2)))

(factory 0 0)